import '../Layout/layout.css'
import { Button } from 'antd';
const Layout = ({children}) => (
    <div className="body">
        <div className="header">
            <img src="https://p.w3layouts.com/demos/coffee_shop/web/images/logo.png"  />
            <Button type="primary"  />
        </div>
        
        {children}
    </div>
)
export default Layout;
